import React from 'react';
import './styles/navigation.css';
import './styles/home.css';
import IconButton from '@mui/material/IconButton';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import GitHubIcon from '@mui/icons-material/GitHub';
import EmailIcon from '@mui/icons-material/Email';
import DescriptionIcon from '@mui/icons-material/Description';
import { Link } from '@mui/material';

const navLinkStyles = {
	fontSize: '2.5em',
	color: 'var(--primary-color)',
	transition: '0.2s',
	'&:hover': {
	  color: 'var(--white)',
	  transform: 'translateY(-5px)',
	},
};

const Navbar = () => {


	return (
		<nav className="navigation">
		<ul className="navigation-list">
			<li className="navigation_link">
			<IconButton component={Link} href="./files/rodriguez2024.pdf" target="_blank" rel="noopener noreferrer"
				sx={navLinkStyles}>
				<DescriptionIcon />
			</IconButton>
			</li>
			<li className="navigation_item">
			<IconButton component={Link} href="https://www.linkedin.com/in/nelson-rodriguez13/" target="_blank" rel="noopener noreferrer"
				sx={navLinkStyles}>
				<LinkedInIcon />
			</IconButton>
			</li>
			<li className="navigation_item">
			<IconButton component={Link} href="https://github.com/Yugenero" target="_blank" rel="noopener noreferrer"
				sx={navLinkStyles}>
				<GitHubIcon />
			</IconButton>
			</li>
			<li className="navigation_item">
			<IconButton component={Link} href="mailto: neroxv1313@gmail.com" target="_blank" rel="noopener noreferrer"
				sx={navLinkStyles}>
				<EmailIcon />
			</IconButton>
			</li>
		</ul>
		</nav>
	);
};

export default Navbar;
